import { Component } from 'react';
import ReactLoading from 'react-loading';
import MaterialTable from 'material-table';
import Config from '../../config.json';
import axios from 'axios';
import Studentnav from '../studentnav';
import dateFormat from 'dateformat';
import { Link } from 'react-router-dom';
import Issue from '../Issue';

class StudyMaterialSubject extends Component {
    constructor() {
        super();
        let data = localStorage.getItem("userdetail");
        data = JSON.parse(data);
        this.state = {
            user: data.username,
            token: data.token,
            isloading: false,
            subjects: [],
            sectionid: ''
        }
        this.baseState = this.state;
    }
    componentDidMount = () => {
        var formdata = new FormData();
        this.setState({ isloading: true });
        formdata.append('page_name', 'Assingments-Subjects');
        var requestOptions = {
            method: 'POST',
            body: formdata,
            redirect: 'follow',
            headers: {
                'Authorization': 'Token ' + this.state.token
            },
        };
        fetch(Config.SERVER_URL + "users/post-analytics/", requestOptions)
            .then(response => response.json())
            .then(json => {
                // console.log(json);
            })
            .catch(error => {
                this.props.history.push('/error');
            });
        var requestOptions1 = {
            redirect: 'follow',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
                'Authorization': 'Token ' + this.state.token
            },
        };
        axios.get(Config.SERVER_URL + 'users/get-student-details/?username=' + this.state.user, requestOptions1)
            .then(response => {
                console.log(response.data)
                this.setState({
                    sectionid: response.data.student_data.section_assoc.id,
                })
                var ch = response.data;
                axios.get(Config.SERVER_URL + 'support/get-subject-class-binding/?is_main_subject=true&class_id=' + ch.student_data.section_assoc.class_assoc, requestOptions1)
                    .then(response => {
                        // console.log(response.data)
                        const lang = response.data;
                        this.setState({
                            subjects: lang,
                            isloading: false,
                        });
                    })
                    .catch(error => {
                        this.props.history.push('/error')
                    });
            })
            .catch(error => {
                this.props.history.push('/error');
            });


    }

    onView = (item) => {
        // console.log(item)
        this.props.history.push(
            {
                pathname: '/student/StudyMaterialList',
                state: {
                    subject: item,
                    sectionid: this.state.sectionid
                },
            }
        )
    }

    render() {
        // console.log(this.state.subjects);
        var mess = (<p>{this.state.message}</p>);
        var load;
        if (this.state.isloading) {
            load = (<p><ReactLoading type="spinningBubbles" color="blue" height="3px" /></p>)
        }
        var dateFormat = require("dateformat");
        var now = new Date();

        return (
            <div>
                <Issue />
                <Studentnav />
                <div className="container">
                    <div>

                        <div className="row" style={{ marginTop: '50px' }}>
                            <div className="col-md-12">
                                <div class="title">
                                    <p style={{ fontFamily: 'Montserrat', fontWeight: 'bold', fontSize: '20px', display: 'inline-block' }}>List of Subject</p>
                                </div>

                                <div class="row" style={{ marginTop: '50px' }}>
                                    {this.state.subjects.map((item) => (<div class="col-md-3" style={{ marginBottom: '30px' }}>
                                        <div class="box" style={{ padding: '0 0 10px 0', borderRadius: '10px', boxShadow: ' 0px 2px 4px rgba(0, 0, 0, 0.25)' }}><center><svg style={{ width: '100%', height: 'auto', marginBottom: '20px' }} viewBox="0 0 292 146" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                                            <rect x="-5.6499" y="-1.0282" width="301.389" height="147.028" fill="url(#pattern0)" />
                                            <defs>
                                                <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                                                    <use xlinkHref="#image0" transform="translate(0 -0.076527) scale(0.003125 0.00640586)" />
                                                </pattern>
                                                <image id="image0" width="320" height="180" xlinkHref="data:image/jpeg;base64," />
                                            </defs>
                                        </svg></center><div class="row"><center><div class="col-xs-12"><p style={{ fontSize: '12px', fontFamily: 'Montserrat', color: '#000000', fontWeight: 'bold' }}>{item.subject_name}</p></div></center></div><br /><center><button onClick={() => this.onView(item)} type="button" class="btn" style={{ border: 'none', color: 'white', background: '#EB7926', fontSize: '10px', fontFamily: 'Montserrat', borderRadius: '63px', width: '100px' }}>View</button></center></div></div>))}
                                </div>
                            </div>

                        </div>

                    </div>
                </div>
            </div>

        );
    }
}
export default StudyMaterialSubject;

